con:configuration.scriptText:
// Define la expresión XPath
def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
def responseXml = messageExchange.responseContent
def xmlHolder = groovyUtils.getXmlHolder(responseXml)

// Extrae el valor del ID
def id = xmlHolder.getNodeValue("//task/id")
log.info "El ID extraído es: ${id}"

// Guarda el ID como propiedad en el contexto
context.testCase.setPropertyValue("TaskID", id)
